import React from 'react';
import Styled from 'styled-components';


export default function HeaderMain(props){
    const HeaderSection = Styled.header`
        height: ${props.headerHeight},
        background-color:${props.bgColor}
    `;
    return(
        <HeaderSection />
    )
}
